import React from "react";

import styles from "./About.module.css";

const About = () => (
  <div className={styles["about"]}>
    <h2>About</h2>
    <p>
      Mi nombre es Ángel Vásquez, soy psicólogo egresado de la UNAM, estudie
      matemáticas en la UAM y programación en Platzi.{" "}
    </p>
    <p>
      Soy columnista de la revista del Colegio de Bachilleres donde hablo sobre
      temas de educación online.
    </p>
    <p>
      He sido voluntario en varias Organizaciones Civiles de la Ciudad de
      México, hoy que sé programar, empiezo a tener contacto con ellos para
      crearles, modificarles o actualizarles sus plataformas. Sí conoces a
      alguien que necesite ayuda, compartele mi contacto, por favor.
    </p>
  </div>
);

export default About;
